pragma solidity ^0.8.0;

contract FeelessCalculator {
    address public owner;
    
    event Sum(uint256 indexed a, uint256 indexed b, uint256 result);
    
    constructor() {
        owner = msg.sender;
    }
    
    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }
    
    function sum(uint256 _a, uint256 _b) external returns (uint256) {
        uint256 result = _a + _b;
        emit Sum(_a, _b, result);
        return result;
    }
    
    function giveMoneyToContract() external payable onlyOwner {
        // El owner le da dinero al contrato
    }
    
    receive() external payable {
        // Esto permite que el contrato reciba ether
    }
}

